import React, {Component} from 'react';
import './App.css';
import Receipts from './components/receipts';

class App extends Component {

    state = {
        receipts: []
    }

    componentDidMount() {
        // fetch('/api/hello')
        //     .then(res => res.json())
        //     .then((data) => {
        //         this.setState({ contacts: data })
        //     })
        //     .catch(console.log)
        this.readServerString("/api/hello"),
            function(err, res) {
                if(err) {
                    console.log(err);
                } else {
                    this.setState({result: res});
                }
            }.bind(this);
    }

    render() {
        return (
            <Receipts receipts={this.state.receipts} />
        );
    }
}
export default App;
